import React, { useState, useEffect } from 'react';

class DataFetching extends React.PureComponent {
  async componentDidMount() {
    var requestedURL =
      'https://cors-anywhere.herokuapp.com/https://localhost:7275/Client/GetAllClients';
    const response = await fetch(requestedURL);
    const data = await response.json();
    console.log(data);
  }

  render() {
    return <div></div>;
  }
}

export default DataFetching;
